import React, { useState } from 'react';
// Anda mungkin ingin mengimpor Link dari react-router-dom di App.js, tapi untuk saat ini, kita akan fokus pada styling

const LoginPage = () => {
    // State dan fungsi handleSubmit sama seperti sebelumnya...
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [message, setMessage] = useState('');

    const handleSubmit = async (e) => {
        e.preventDefault();
        setMessage('Sedang memproses...');
        // ... Logika Fetch API sama seperti sebelumnya (POST /api/auth/login) ...
        try {
            const response = await fetch('http://localhost:3001/api/auth/login', { 
                method: 'POST',
                headers: { 'Content-Type': 'application/json' },
                body: JSON.stringify({ email, password })
            });
            const data = await response.json();
            if (response.ok) {
                localStorage.setItem('token', data.token); 
                setMessage('Login Berhasil!');
            } else {
                setMessage(`Login Gagal: ${data.message}`);
            }
        } catch (error) {
            setMessage('Terjadi kesalahan koneksi.');
        }
    };

    // --- STYLING ESTETIK BARU ---
    const primaryColor = '#3b82f6'; // Biru cerah
    const bgColor = '#1e3a8a'; // Biru gelap untuk latar belakang
    
    const containerStyle = {
        minHeight: '100vh',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        background: `linear-gradient(135deg, ${bgColor} 0%, #172554 100%)`, // Gradien latar belakang
    };

    const formBoxStyle = {
        padding: '50px 40px',
        borderRadius: '20px', // Sudut lebih melengkung
        boxShadow: '0 10px 30px rgba(0, 0, 0, 0.25)',
        backgroundColor: 'white',
        width: '100%',
        maxWidth: '400px',
        textAlign: 'center',
    };

    const inputGroupStyle = {
        textAlign: 'left',
        marginBottom: '20px',
    };

    const inputStyle = {
        width: '100%',
        padding: '12px',
        marginTop: '8px',
        border: '1px solid #e5e7eb',
        borderRadius: '10px',
        boxSizing: 'border-box',
        fontSize: '16px',
        transition: 'border 0.3s',
    };
    // Tambahkan style untuk hover/focus di CSS global jika memungkinkan

    const buttonStyle = {
        background: primaryColor,
        color: 'white',
        padding: '15px 20px',
        border: 'none',
        borderRadius: '10px',
        cursor: 'pointer',
        width: '100%',
        fontSize: '18px',
        fontWeight: 'bold',
        marginTop: '20px',
        transition: 'background-color 0.3s',
    };

    return (
        <div style={containerStyle}>
            <div style={formBoxStyle}>
                <h2 style={{ fontSize: '24px', fontWeight: 'bold', color: '#1f2937' }}>Portal Akademik</h2>
                <p style={{ color: '#6b7280', marginBottom: '30px' }}>Silakan masuk untuk melanjutkan ke Dashboard</p>
                
                <form onSubmit={handleSubmit}>
                    <div style={inputGroupStyle}>
                        <label style={{ display: 'block', fontWeight: '600', marginBottom: '5px', color: '#4b5563' }}>Email</label>
                        <input 
                            type="email" 
                            value={email} 
                            onChange={(e) => setEmail(e.target.value)} 
                            style={inputStyle}
                            placeholder="nama@universitas.ac.id"
                            required 
                        />
                    </div>
                    <div style={inputGroupStyle}>
                        <label style={{ display: 'block', fontWeight: '600', marginBottom: '5px', color: '#4b5563' }}>Password</label>
                        <input 
                            type="password" 
                            value={password} 
                            onChange={(e) => setPassword(e.target.value)} 
                            style={inputStyle}
                            placeholder="********"
                            required 
                        />
                    </div>
                    <button type="submit" style={buttonStyle}>Masuk Sekarang</button>
                </form>

                <p style={{ marginTop: '30px', color: '#6b7280' }}>
                    Belum punya akun? 
                    <a href="/register" style={{ color: primaryColor, textDecoration: 'none', fontWeight: '600' }}> Daftar disini</a>
                </p>
                <p style={{ color: message.includes('Gagal') ? '#ef4444' : primaryColor, marginTop: '15px', fontWeight: '600' }}>{message}</p>
            </div>
        </div>
    );
};

export default LoginPage;
